// Home.js
import React from 'react';
import '../styles/home.css';

function Home() {
  return (
    <div className="home-container">
      <h2 className="home-title">Домашняя страница</h2>
      <p className="home-content">Добро пожаловать на нашу домашнюю страницу! Здесь вы найдете множество интересной информации о нашей компании.</p>
    </div>
  );
}

export default Home;
